let _fslex_tables = Microsoft.FSharp.Text.Lexing.UnicodeTables.Create (trans, actions)
let rec _fslex_dummy () = _fslex_dummy ()

(* Rule token *)
and token  (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    _fslex_token 65 lexbuf

and _fslex_token  _fslex_state lexbuf =
    match _fslex_tables.Interpret (_fslex_state, lexbuf) with
    | 0 ->
        let p = lexbuf.StartPos
        header p (StringBuilder 100) lexbuf
    | 1 ->
        PERCENT_PERCENT
    | 2 ->
        typeDepth := 1
        startPos := lexbuf.StartPos
        clearBuf ()
        TOKEN (fs_type lexbuf)
    | 3 ->
        TOKEN None
    | 4 ->
        START
    | 5 ->
        PREC
    | 6 ->
        typeDepth := 1
        startPos := lexbuf.StartPos
        clearBuf ()
        match fs_type lexbuf with
        | Some x ->
            TYPE x
        | None ->
            failwith "gettype"

    | 7 ->
        LEFT
    | 8 ->
        RIGHT
    | 9 ->
        NONASSOC
    | 10 ->
        ERROR
    | 11 ->
        LESS
    | 12 ->
        GREATER
    | 13 ->
        SEMI
    | 14 ->
        let p = lexbuf.StartPos
        let buff = StringBuilder 100
        // adjust the first line to get even indentation for all lines w.r.t. the left hand margin
        buff.Append (String.replicate (lexbuf.StartPos.Column + 1) " ") |> ignore
        code p buff lexbuf
    | 15 ->
        token lexbuf
    | 16 ->
        newline lexbuf; token lexbuf
    | 17 ->
        IDENT (lexeme lexbuf)
    | 18 ->
        BAR
    | 19 ->
        ignore(comment lexbuf); token lexbuf
    | 20 ->
        token lexbuf
    | 21 ->
        COLON
    | 22 ->
        unexpected_char lexbuf
    | 23 ->
        EOF
    | _ ->
        failwith "token"

(* Rule fs_type *)
and fs_type  (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    _fslex_fs_type 61 lexbuf

and _fslex_fs_type  _fslex_state lexbuf =
    match _fslex_tables.Interpret (_fslex_state, lexbuf) with
    | 0 ->
        incr typeDepth
        appendBuf (lexeme lexbuf)
        fs_type lexbuf
    | 1 ->
        decr typeDepth
        if !typeDepth = 0 then
            Some <| string str_buf
        else
            appendBuf (lexeme lexbuf)
            fs_type lexbuf
    | 2 ->
        appendBuf (lexeme lexbuf)
        fs_type lexbuf
    | _ ->
        failwith "fs_type"

(* Rule header *)
and header p buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    _fslex_header p buff 42 lexbuf

and _fslex_header p buff _fslex_state lexbuf =
    match _fslex_tables.Interpret (_fslex_state, lexbuf) with
    | 0 ->
        //HEADER (buff.ToString(), p)
        HEADER (Some <| buff.ToString())
    | 1 ->
        newline lexbuf
        ignore <| buff.Append System.Environment.NewLine
        header p buff lexbuf
    | 2 ->
        ignore <| buff.Append (lexeme lexbuf)
        header p buff lexbuf
    | 3 ->
        ignore <| buff.Append (lexeme lexbuf)
        header p buff lexbuf
    | 4 ->
        ignore <| buff.Append (lexeme lexbuf)
        header p buff lexbuf
    | 5 ->
        ignore <| buff.Append (lexeme lexbuf)
        ignore(codestring buff lexbuf)
        header p buff lexbuf
    | 6 -> EOF
    | 7 ->
        ignore <| buff.Append(lexeme lexbuf).[0]
        header p buff lexbuf
    | _ ->
        failwith "header"

(* Rule code *)
and code p buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    _fslex_code p buff 23 lexbuf

and _fslex_code p buff _fslex_state lexbuf =
    match _fslex_tables.Interpret(_fslex_state,lexbuf) with
    | 0 ->
        //CODE (buff.ToString(), p)
        CODE (Some <| buff.ToString())
    | 1 ->
        ignore <| buff.Append (lexeme lexbuf)
        ignore (code p buff lexbuf)
        ignore <| buff.Append "}"
        code p buff lexbuf
    | 2 ->
        newline lexbuf
        ignore <| buff.Append System.Environment.NewLine
        code p buff lexbuf
    | 3 ->
        ignore <| buff.Append (lexeme lexbuf)
        code p buff lexbuf
    | 4 ->
        ignore <| buff.Append (lexeme lexbuf)
        ignore (codestring buff lexbuf)
        code p buff lexbuf
    | 5 ->
        ignore <| buff.Append (lexeme lexbuf)
        code p buff lexbuf
    | 6 ->
        ignore <| buff.Append (lexeme lexbuf)
        code p buff lexbuf
    | 7 -> EOF
    | 8 ->
        ignore <| buff.Append (lexeme lexbuf).[0]
        code p buff lexbuf
    | _ ->
        failwith "code"

(* Rule codestring *)
and codestring buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    _fslex_codestring buff 12 lexbuf

and _fslex_codestring buff _fslex_state lexbuf =
    match _fslex_tables.Interpret (_fslex_state, lexbuf) with
    | 0 ->
        ignore <| buff.Append (lexeme lexbuf)
        codestring buff lexbuf
    | 1 ->
        ignore <| buff.Append (lexeme lexbuf)
        buff.ToString ()
    | 2 ->
        newline lexbuf
        ignore <| buff.Append System.Environment.NewLine
        codestring buff lexbuf
    | 3 ->
        ignore <| buff.Append (lexeme lexbuf)
        codestring buff lexbuf
    | 4 ->
        failwith "unterminated string in code"
    | 5 ->
        ignore <| buff.Append(lexeme lexbuf).[0]
        codestring buff lexbuf
    | _ ->
        failwith "codestring"

(* Rule comment *)
and comment  (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    _fslex_comment 0 lexbuf

and _fslex_comment  _fslex_state lexbuf =
    match _fslex_tables.Interpret (_fslex_state, lexbuf) with
    | 0 ->
        ignore (comment lexbuf)
        comment lexbuf
    | 1 ->
        newline lexbuf
        comment lexbuf
    | 2 -> ()
    | 3 ->
        failwith "end of file in comment"
    | 4 ->
        comment lexbuf
    | 5 ->
        comment lexbuf
    | _ ->
        failwith "comment"
